import React, { Component } from 'react'
import '../App.css'


export class Second_nav extends Component {
  render() {
    return (
      <React.Fragment>
          <div style={{color: '#fff',textAlign: 'center',height:'100px',marginTop: '-10px',background:'#71c5a5'}}>
            <h3 style={{marginTop: '40px'}}>School Management System</h3>
          </div>
      </React.Fragment>
    )
  }
}

export default Second_nav
